    <React.Fragment>
      <div ref={divRef}></div>
      <Grid
        container
        spacing={2}
        alignItems="stretch"
        justifyContent="center"
        direction="row"
        className={classes.bar}
      >
        <Grid item xs={6} style={{ textAlign: "right", marginTop: "0.5em" }}>
          <Typography className={classes.text} component="p">
            Â© Copyright - AC Engineering, Inc. All Rights Reserved | Developed
            by Edward Briscoe
          </Typography>
        </Grid>
        <Grid
          item
          xs={6}
          style={{
            textAlign: "left",
            marginTop: "0.5em",
            marginBottom: "0.5em",
          }}
