            to="/about"
            style={{ textDecoration: "none" }}
          >
            About Us |{" "}
          </Typography>
          <Typography
            className={classes.text}
            component={Link}
            to="/services"
            style={{ textDecoration: "none" }}
          >
            Services |{" "}
          </Typography>
          <Typography
            className={classes.text}
            component={Link}
            to="/mobiledatacenters"
            style={{ textDecoration: "none" }}
          >
            Mobile Data Centers |{" "}
          </Typography>
          <Typography
            className={classes.text}
            component={Link}
            to="/contact"
            style={{ textDecoration: "none" }}
          >
            Contact Us
          </Typography>
        </Grid>
        <Box sx={{ display: "flex" }} className={classes.bar}></Box>
      </Grid>
    </React.Fragment>
  );
}
